import React, { useState } from 'react';
import '../stylesheets/home.css';
import store from "../store";


//{ToDoObject(CurrentList)}
const Tasks = (store, list) => store.getState()[list].map(i =>
    <li>{i}</li>
)
function List() {
    return (
        <h1>Hello, {store.getState().ToDoObject[store.getState().CurrentList]}</h1>
    )
}

export default List;
